import React from "react";

function OtherPayments() {
  return (
    <>
If you clicked this link I am assuming 1 of 3 things:
<br></br>
1. Your name is Josh and you did not see an option for checks so you selected cash hoping it will give the info for how to do a check.
<br></br>
*Please make checks payable to Joseph Cooper*
<br></br>
2. Your name is Josh and you did not see the basket to insert cash to your left.
<br></br>
3. You came here expecting some form of humor, well there you go. Now go give Josh crap!
    </>
  );
}

export default OtherPayments;
